import React from 'react';

const Step4 = ({ prevStep }) => {
    return (
        <div className="w-full max-w-lg mx-auto mt-10 bg-white p-6 rounded-lg shadow-md">
            <h2 className="text-2xl font-bold text-custom-font mb-4">Success!</h2>
            <p className="text-lg text-custom-font mb-6">You have successfully signed up.</p>
            <button
                onClick={prevStep}
                className="bg-purple-600 hover:bg-purple-700 text-white font-bold py-2 px-4 rounded focus:outline-none focus:shadow-outline"
            >
                Back
            </button>
        </div>
    );
};

export default Step4;
